/* eslint-disable import/no-anonymous-default-export */
const defaultState = {
  inputValue: '123',
  list: [1,2]
}
// Reducer相当于一个笔记本，state 可以理解为整个store仓库里存储的数据
export default (state = defaultState, action) => {

  return state;

}
